import React from 'react';

import './styles.css';
import { Link } from 'react-router-dom';
import profileIcon from '../../images/profileIcon.svg';

const Header = () => (
  <div className="header">
    <header>
      <Link to="/">
        <img
          src={profileIcon}
          alt="huhu"
        />
      </Link>
    </header>
  </div>
);

export default Header;
